function processInput(i) {
	if (i[0].trim() == "") {return;}
	var processedData = intentRecognition(i[0].replace(/\?/g, ' ?').replace(/\!/g, ' !').replace(/\./g, ' .').replace(/\,/g, ' ,'));
	var key = processedData[0];
	var response = processedData[1];
	if (key.toLowerCase() == 'gps') {
		var regex = /\b[A-Z][a-zA-Z]*\b/g;
		var destination = i[0].match(regex).slice(1);
		var url = 'https://www.google.com/maps/dir/current+location/'+destination.join("+");
	} else if (key.toLowerCase() == 'video') {
		var url = 'https://www.google.com/search?q='+i[0].replace(/ /g, '+')+'&tbm=vid';
	} else if (key.toLowerCase() == 'images') {
		var url = 'https://www.google.com/search?q='+i[0].replace(/ /g, '+')+'&tbm=isch';
	} else if (key.toLowerCase() == 'flight') {
		var regex = /\b[A-Z][a-zA-Z]*\b/g;
		var destination = i[0].match(regex).slice(1);
		var url = 'https://www.google.com/travel/flights?output=search&q=flights+to+'+destination.join("+");
	} else if (key.toLowerCase() == 'play') {
		var url = 'https://www.google.com/search?q=' + i[0].replace(/ /g, '+') + '&btnI';
	} else if (key.toLowerCase() == 'websearch') {
		var url = 'https://www.google.com/search?q=' + i[0].replace(/ /g, '+') + '&btnI';
	} else {
		var url = '';
	}
	
	document.getElementById(i[1]).innerHTML = document.getElementById(i[1]).innerHTML + '<div style="margin: 10px; padding: 10px; background-color: lightgreen; border-radius: 10px; text-align: left;"><a href="'+url+'" target="_blank">' + i[0] + '</a></div>'
	document.getElementById(i[1]).innerHTML = document.getElementById(i[1]).innerHTML + '<div style="margin: 10px; padding: 10px; background-color: #DDDDDD; border-radius: 10px; text-align: right;">' + response + '</div>'
	
	document.getElementById(i[1]).scrollTop = document.getElementById(i[1]).scrollHeight;

	console.log('url: '+ url);
	if (url != '') {window.open(url, target='blank');}

	myStoreData()
}

function getLemmaIntentData() {
	var out = {};
	for (key in intentData) {
		out[key] = myLemma(intentData[key].join(" ").trim()).trim().split(" ");
	}
	var outputDict = {};
	for (key in out) {
		var obj = out[key];
		for (o=0; o<obj.length; o++) {
			var currentWord = obj[o];
			if (currentWord in outputDict) {
				if (outputDict[currentWord].indexOf(key) == -1) {
					outputDict[currentWord] = outputDict[currentWord] + ' ' + key;
				}
			} else {
				outputDict[currentWord] = key;
			}
		}
	}

	return [out, outputDict]
}

function getAllIntentData() {
	var all = '';
	for (key in intentData) {
		var all = all + intentData[key].join(" ");
	}
	var all = all.trim();
	return all.split(" ")
}

function myLemma(i) {
	// console.log(lemmaData);
	var i = i.toLowerCase();
	for (x in abriviations) {
		var i = i.split(x).join(abriviations[x]);
	}
	var i = i.trim()
	var iObj = i.split(" ");
	var lemmaString = "";
	for (a=0; a<iObj.length; a++) {
		var word = iObj[a];
		if (word in lemmaData) {
			var lemmaWord = lemmaData[word];
		} else {
			var lemmaWord = word;
		}
		var lemmaString = lemmaString + lemmaWord + ' ';
	}
	var lemmaString = lemmaString.trim();
	return lemmaString
}

function prepositionReorder(i) {
	var lemmaInput = myLemma(i);
	var lemmaInput = " " + lemmaInput + " ";
	var prepositionSymbol = " ` "
	for (p=0; p<prepositions.length; p++) {
		// var lemmaInput = lemmaInput.split(" " + prepositions[p] + " ").join(prepositionSymbol + " " + prepositions[p].toUpperCase() + " ")
		var lemmaInput = lemmaInput.split(" " + prepositions[p] + " ").join(prepositionSymbol)
	}
	var lemmaInput = lemmaInput.trim();

	var symbolObj = lemmaInput.split(prepositionSymbol);
	var reorderedString = ''
	for (s=0; s<symbolObj.length; s++) {
		var reorderedString =  symbolObj[s].trim() + " " + reorderedString
	}
	return reorderedString.trim().toLowerCase()
}

function intentRecognition(i) {
	// console.log(allIntentData.join(" "));
	var i = prepositionReorder(i.toLowerCase().trim());
	var iObj = i.split(" ");
	var allIntentDataText = " " + allIntentData.join(" ") + " ";
	var matchCount = 0;
	var intentDict = {};
	for (z=0; z<iObj.length; z++) {
		var word = iObj[z];
		var val = z + 1;
		if (allIntentDataText.indexOf(word) > -1) {var matchCount = matchCount + 1}
		if (word in lemmaIntentDict) {
			var intents = lemmaIntentDict[word].trim().split(" ");
			for (x=0; x<intents.length; x++) {
				var intent = intents[x];
				if (intent != '') {
					// console.log(intent + ' -> '+ val);
					if (intent in intentDict) {intentDict[intent] = intentDict[intent] + val;} else {intentDict[intent] = val;}
				}
			}
		}
	}
	let maxKey, maxValue = 0;
	for(const [key, value] of Object.entries(intentDict)) {
		if(value > maxValue) {
			maxValue = value;
			maxKey = key;
		}
	}
	if (maxValue >= 0.5*i.split(" ").length && matchCount/i.split(" ").length >= 0.5) {
		console.log('Intent is: "'+maxKey+'"');
		console.log('Response is: "'+responseData[maxKey]+'"');
		console.log(intentDict);
		return [maxKey, responseData[maxKey]]
	} else {
		console.log('Default Web Search')
		return ['websearch', 'Initiating internet search']
	}
}

